import React from "react";
import Header from "./components/Header";
import Cards from "./components/Cards";


class App extends React.Component{
  render(){
    return(
      <div>
        <Header/>
        <h1>Популярное:</h1>
        <Cards/>
      </div>
    )
  }
}

export default App
